import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginRegister from './LoginRegister';

const App = () => {
  return (
    <Router>
       <Route path="/login" element={<LoginRegister/>} />
    </Router>
  );
};

export default App;
